import React from 'react';


export class NavBar extends React.Component {
  render() {
    const pages = ['home', 'about', 'blog', 'contact'];

    const navLinks = pages.map(page => {
      return (
        <li className="selected">
          <a href={'/' + page}>
            {page}
          </a>
        </li>
      )
    });

    const headerSection = (
      <div id="header">
